import React from "react";
import logo from "../../assets/Logo.png";
import Button from "../Button";

/**
 * Navbar component
 */
const Nav = () => {
  return (
    <nav className="w-full px-4 py-3">
      <img src={logo} alt="Logo" />

      <Button />
    </nav>
  );
};

export default Nav;
